import React from 'react';
import './MainContent.css'
import {Grid} from "@material-ui/core";

function MainContent() {
  return (
    <div>
        <Grid container>
            <Grid item xs={2}></Grid>
            <Grid item xs={6}></Grid>
            <Grid item xs={2}></Grid>
            <Grid item xs={2}></Grid>
        </Grid>
    </div>
  );
};

export default MainContent;
